review:
///Update///

149 rounds recorded. iPhone 3GS. Battery 70-80% left after rounds. Still no side game tracking but the notes feature works somewhat for that. Finally fivesomes! Sixsomes! THE BEST APP FOR GOLF!

17 rounds under my belt with this app now and still very happy. The new in-app stats (v.1.3) blew me away!  Still waiting for side games (skins, etc.). Im confused why so many golfers leave their phone on the entire round? I pull mine out as Im walking up to my ball, usually while Im 20-30 yards away, I get positive satellite lock by the time Im standing over the ball, read my yardage and put the phone back to sleep. After putting I whip it out, score the entire foursome (takes about 15 seconds total) and then put it back to sleep. I consistently have 80-85% battery life after my round is complete.

Once we get side games/betting included in a future update I will be even more of a cheerleader for this app!   
////////////////////\\\\\\\\\\\\\\\\\\\\Used Golfshot for my last 6 rounds and I will continue to use it forever! Its accurate, easy to use, and being able to email your scorecard to your buddies and review actual stats for yourself are perks I didnt know I wanted, but now I cant live without!

Ended up being cheaper to buy a new iPhone 3GS AND this app than the skycaddie I was looking at. Stand alone golf GPS units are in serious trouble.

